import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>单细胞分析平台</h1>
        <p>
          欢迎使用单细胞分析大模型平台。请上传你的单细胞数据文件，平台将自动为你分析并生成总结。
        </p>
      </header>
    </div>
  );
}

export default App;
